content: >-
  <p class="p"><span data-number="33" data-sid="GEN 31:33"
  class="v">33</span>And Laban went into Jacob’s tent, and into Leah’s tent, and
  into the two maidservants’ tents; but he found <span class="add">them</span>
  not. Then went he out of Leah’s tent, and entered into Rachel’s tent. </p>
